import React from 'react'
import { Switch, Route, Link} from "react-router-dom";
import Home from '../Pages/Home'

const RouteList:React.FC = () =>{
    return 
    <Switch>
        <Route exact path='/' ><Home /></Route>
    </Switch>
}

export default RouteList
